  return (
    <div className="App">
      <header className="App-header">
        <h1> Fruit Market</h1>
      </header>
      <div id="Grid"> 
        <Card
          style={{
            width: 300,
            margin: 20,
            padding: 0,
          }}
          cover={
            <img
              alt="example"
              src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
            />
          }
        >
          <Meta
            title="Strawberries"
            description="$3.99"
          />
        </Card>
        <Card
          style={{
            width: 300,
            margin: 20,
