            <img
              alt="example"
              src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
            />
          }
        >
          <Meta
            title="Strawberries"
            description="$3.99"
          />
        </Card>

      </div>
    </div>
  );
}

export default App;
